import React from 'react';
import { render } from '@testing-library/react';


const ImagesList = (props) => {

    const images = props.ImagesList.map((image) => {
    return <img src={images.urls.regular} />
    });

    return(
        <div>
            {images}
        </div>

    ); 
};

export default ImagesList;
